// ChatbotInterface.js
import React from "react";

function ChatbotInterface() {
  return (
    <div className="p-8">
      <h2 className="text-3xl font-bold mb-4">Chatbot Interface</h2>
      <div className="bg-white shadow-lg rounded-lg p-4">
        {/* Basic Chatbot UI (You can integrate an actual chatbot here) */}
        <div className="chatbot-window bg-gray-100 p-4 rounded-lg h-64">
          <p className="text-gray-700">[Chatbot]: Hello! How can I help you today?</p>
          {/* User input field */}
          <div className="mt-4">
            <input
              type="text"
              placeholder="Type your message..."
              className="w-full p-2 border border-gray-300 rounded-lg"
            />
          </div>
        </div>
      </div>
    </div>
  );
}

export default ChatbotInterface;
